INSERT INTO `django_flatpage` VALUES (1,'/ayuda/','Ayuda','Bienvenido a la ayuda del sistema del Observatorio de Soberanía y Seguridad Alimentaria (GISSAN). \r\n\r\nEl sistema ofrece información sobre indicadores:\r\n <ul>\r\n<li><a href=\"/ayuda/demografico/\">Demográficos</a></li>\r\n<li><a href=\"/ayuda/economico/\">Económico</a></li>\r\n<li><a href=\"/ayuda/seguridad-alimentaria/\">Seguridad Alimentaria</a></li>\r\n<li><a href=\"/ayuda/sequia/\">Encuesta de Sequía</a></li>\r\n</ul>\r\n\r\nPara mas información de click en las opciones presentadas.',0,'',0),(2,'/ayuda/economico/','Ayuda - Económico','<h1>Económico</h1> \r\n<a href=\"/ayuda/\">Regresar a Ayuda</a>\r\n<p>La sección de indicadores económicos se puede acceder dando click a la pestaña económico en el menú principal.</p>\r\n\r\n<img src=\"/imagen/ayuda/menu-economico.png\" />\r\n\r\n</p>Luego podrá dar click a las diferentes opciones que están disponibles. </p>\r\n\r\n<h2>Canasta Básica</h2>\r\n<p>Este indicador muestra valores de los distintos tipos de canastas básicas a través del tiempo. Puede especificar un rago de años y/o un tipo específico de canasta para que se muestre de forma detallada haciendo uso del formulario que se encuentra en la parte superior de la tabla.</p>\r\n\r\n<p>Para ver un gráfico puede dar click en el enlace de gráfico y este aparecerá en la parte superior de la tabla. Si desea ordenar los datos puede dar click en la columnas de tipo para ordenar de mayor a menor y viceversa.</p>\r\n\r\n<img src=\"/imagen/ayuda/canastabasica-tabla.png\" border=2/>\r\n \r\n<h2>Mercados</h2>\r\n<p>Muestra la lista de mercados según departamento y municipio y año de fundacion.</p>\r\n\r\n<h2>Empleo</h2>\r\n<p>Esta tabla muestra una serie de indicadores relacionados con el empleo a través del tiempo. Puede especificar un rango de años haciendo uso del formulario en la parte superior de la tabla.</p>\r\n\r\n<h2>Salario Mínimo</h2>\r\n<p>Este indicador muestra valores del salario mínimo agrupado por sectores a través del tiempo. Tiene la opcion de especificar un rango de años y/o un sector de salario mínimo para mas detalle haciendo uso del formulario en la parte superior de la tabla.</p>\r\n\r\n<p>Para ver un gráfico puede dar click en el enlace de gráfico y este aparecerá en la parte superior de la tabla. Si desea ordenar los datos puede dar click en la columnas de tipo para ordenar de mayor a menor y viceversa.</p>\r\n\r\n<h2>Salario Nominal Real</h2>\r\n<p>Este indicador muestra valores del salario nominal real agrupado por sectores a través del tiempo. Tiene la opcion de especificar un rango de años haciendo uso del formulario en la parte superior de la tabla.</p>\r\n\r\n<p>Para ver gráficos puede dar click en los enlaces correspondientes al tipo de gráfico que desea ver tiene disponible el grafico de <b>salario mínimo nominal</b> y el gráfico de <b>salario mínimo real</b> estos aparecerán en la parte superior de la tabla.</p>',0,'',0),(3,'/ayuda/demografico/','Ayuda - Demográfico.','<h1>Demográfico</h1> \r\n<a href=\"/ayuda/\">Regresar a Ayuda</a>\r\n<p>La sección de indicadores demográficos se puede acceder dando click a la pestaña Demográfico en el menú principal.</p>\r\n\r\n<img src=\"/imagen/ayuda/menu-poblacion.png\" />\r\n\r\n</p>Luego podrá dar click a las diferentes opciones que están disponibles. </p>\r\n\r\n<h2>Población</h2>\r\n<p>Este indicador muestra valores de las poblaciones según clasificación de hombre urbano, mujer urbana, hombre rural y mujer rural a nivel nacional y por departamentos. Puede especificar un rango de años y/o un departamento .</p>\r\n\r\n<img src=\"/imagen/ayuda/poblacion-rango.png\" border=2/>\r\n \r\n\r\n<p>Para ver un gráfico puede dar click en el enlace de gráfico y este aparecerá en la parte superior de la tabla. </p>\r\n\r\n<img src=\"/imagen/ayuda/poblacion-grafico.png\" border=2/>\r\n\r\n<p>Si desea ordenar los datos puede dar click en la columnas de tipo para ordenar de mayor a menor y viceversa.</p>\r\n\r\n<img src=\"/imagen/ayuda/poblacion-ordenar.png\" border=2/>\r\n',0,'',0),(4,'/ayuda/seguridad-alimentaria/','Ayuda - Seguridad Alimentariaa','<h1>Seguridad Alimentaria</h1> \r\n<a href=\"/ayuda/\">Regresar a Ayuda</a>\r\n<p>La sección de indicadores económicos se puede acceder dando click a la pestaña Seguridad Alimentaria en el menú principal.</p>\r\n\r\n<img src=\"/imagen/ayuda/menu-seguridad.png\" />\r\n\r\n</p>Luego podrá dar click a las diferentes opciones que están disponibles. </p>\r\n\r\n<h2>Utilización Biológica</h2>\r\n<p>Este indicador muestra la incidencia de enfermedades respiratorias agudas y enfermedades diarreicas agudas a traves del tiempo. Puede especificar un rago de años y/o un departamento para que se muestre de forma detallada haciendo uso del formulario que se encuentra en la parte superior de la tabla.</p>\r\n\r\n<p>Para ver un gráfico puede dar click en el enlace de gráfico y este aparecerá en la parte superior de la tabla. Si desea ordenar los datos puede dar click en la columnas de tipo para ordenar de mayor a menor y viceversa.</p>\r\n\r\n<img src=\"/imagen/ayuda/dependenciaalimentaria.png\" border=2/>\r\n\r\n<h2>Dependencia Alimentaria</h2>\r\n<p>Este indicador muestra valores de dependencia alimentaria agrupado por producto a través del tiempo. Tiene la opción de especificar un rango de años y/o un producto para mas detalle haciendo uso del formulario en la parte superior de la tabla.</p>\r\n\r\n<p>Para ver un gráfico puede dar click en el enlace de gráfico y este aparecerá en la parte superior de la tabla. Si desea ordenar los datos puede dar click en la columnas de tipo para ordenar de mayor a menor y viceversa.</p>\r\n\r\n<h2>Disponibilidad</h2>\r\n<p>Este indicador muestra valores de disponibilidad y consumo aparente correspondientes a los productos. Tiene la opción de especificar un rango de años y/o un producto para mas detalle haciendo uso del formulario en la parte superior de la tabla.</p>\r\n\r\n<p>Para ver un gráfico puede dar click en el enlace de gráfico y este aparecerá en la parte superior de la tabla. Si desea ordenar los datos puede dar click en la columnas de tipo para ordenar de mayor a menor y viceversa.</p>\r\n\r\n<h2>Apertura Comercial</h2>\r\n<p>Este indicador muestra valores de apertura comerciala través del tiempo. Tiene la opcion de especificar un rango de años  haciendo uso del formulario en la parte superior de la tabla.</p>\r\n\r\n<p>Para ver un gráfico puede dar click en el enlace de gráfico y este aparecerá en la parte superior de la tabla. Si desea ordenar los datos puede dar click en la columnas de tipo para ordenar de mayor a menor y viceversa.</p>\r\n',0,'',0),(5,'/ayuda/sequia/','Ayuda - Sequía.','<h1>Sequía</h1>\r\n<p>La sección de sequia pone a su disposición los resultados del <b>Sonde sobre Sequía en Nicaragua</b> realizado en el año 2009. Usted podrá consultar y ver detalladamente datos sobre todos los indicadores resultantes.</p>\r\n\r\n<p>Para iniciar de click en la solapa de sequía en el menú principal.</p>\r\n\r\n<img src=\"/imagen/ayuda/menu-sequia.png\" />\r\n\r\n<h2>Consultar</h2>\r\n\r\n<p>Luego de click en el botón <b>consultar</b> para establecer sus parámetros de consulta.</p>\r\n\r\n<img src=\"/imagen/ayuda/sequia-form.png\" border=1 />\r\n\r\n<p>En este formulario podrá especificar una fecha de inicio y fecha de fin así como también, departamento, municipio, comunidad y entrevistado en caso de desearlo. Si quiere un nivel mas general puede solamente seleccionar las fechas y darle click a consultar para luego poder ver las demas secciones.</p>\r\n\r\n<p><b>Atencion:</b> si no especifica parámetros de consulta las siguientes secciones no podrán ser usadas, favor aplique parametros de consulta primero</p>\r\n\r\n<h2>Pérdida</h2>\r\n<p>Consulta la pérdida de las cosechas de primera y postrera. Puede ver un gráfico dando click al enlace de gráfico en la parte superior de la tabla</p>\r\n<img src=\"/imagen/ayuda/sequia-perdida.png\" border=1 />\r\n\r\n<h2>Disponibilidad</h2>\r\n<p>Consulta la disponibilidad de alimentos en las familias consultadas. Puede consultar los gráficos de cada producto haciendo click en el enlace de gráficos en la parte superior de la tabla.</p>\r\n<img src=\"/imagen/ayuda/sequia-disponibilidad.png\" border=1 />\r\n\r\n<h2>Nutrición</h2>\r\n<p>Consulta el nivel de nutrición en los niños de las familias consultadas por rango de edad. Puede consultar los gráficos haciendo click en el enlace de gráficos en la parte superior de la tabla.</p>\r\n<img src=\"/imagen/ayuda/sequia-nutricion.png\" border=1 />\r\n\r\n<h2>Hoja de Cálculo</h2> \r\nAl hacer click en esta opción comenzará la descarga de un consolidado de la encuesta en formato .xls de Excel acomodados de manera óptima para usarse con programas procesadores de estadísticas.\r\n',0,'',0);
